import React from "react";

const Landing = () => {
  return (
    <div className="pl-10 pr-10">
      <div className="flex justify-between items-center">
        <img src="logo.png" alt="" className="w-1/12" />
        <ul className="flex justify-evenly">
          <li>Home</li>
          <li>About</li>
        </ul>
      </div>
    </div>
  );
};
export default Landing;
